import React, { useState, useEffect, ReactNode } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Mail, Github, Linkedin, Link, Sun, Moon } from "lucide-react";
import profile from "./data/profile.json";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  NavLink,
  NavLinkProps
} from "react-router-dom";

interface ThemeToggleProps {
  toggleTheme: () => void;
  darkMode: boolean;
}

function ThemeToggle({ toggleTheme, darkMode }: ThemeToggleProps) {
  return (
    <Button onClick={toggleTheme} variant="ghost" className="ml-auto">
      {darkMode ? <Sun /> : <Moon />}
    </Button>
  );
}

interface LayoutProps {
  children: ReactNode;
  toggleTheme: () => void;
  darkMode: boolean;
}

function Layout({ children, toggleTheme, darkMode }: LayoutProps) {
  return (
    <div className={`min-h-screen ${darkMode ? "bg-gray-900 text-white" : "bg-white text-black"}`}>
      <div className="max-w-4xl mx-auto p-6 space-y-6">
        <nav className="flex justify-between items-center mb-4">
          <div className="space-x-4">
            <NavLink to="/" className={({ isActive }: { isActive: boolean }) => isActive ? "font-bold underline" : "hover:underline"}>About</NavLink>
            <NavLink to="/experience" className={({ isActive }: { isActive: boolean }) => isActive ? "font-bold underline" : "hover:underline"}>Experience</NavLink>
            <NavLink to="/education" className={({ isActive }: { isActive: boolean }) => isActive ? "font-bold underline" : "hover:underline"}>Education</NavLink>
            <NavLink to="/projects" className={({ isActive }: { isActive: boolean }) => isActive ? "font-bold underline" : "hover:underline"}>Projects</NavLink>
          </div>
          <ThemeToggle toggleTheme={toggleTheme} darkMode={darkMode} />
        </nav>
        {children}
      </div>
    </div>
  );
}

function AboutSection() {
  return (
    <Card className="rounded-2xl shadow-xl">
      <CardContent className="p-6">
        <div className="flex justify-between items-center">
          <div>
            <h1 className="text-3xl font-bold">{profile.name}</h1>
            <p className="text-lg text-gray-600 dark:text-gray-300">{profile.title}</p>
            <p className="text-sm text-gray-500 dark:text-gray-400">{profile.location}</p>
          </div>
          <div className="flex space-x-3">
            <a href={`mailto:${profile.social.email}`}><Mail /></a>
            <a href={profile.social.github} target="_blank" rel="noopener noreferrer"><Github /></a>
            <a href={profile.social.linkedin} target="_blank" rel="noopener noreferrer"><Linkedin /></a>
          </div>
        </div>
      </CardContent>
    </Card>
  );
}

function ExperienceSection() {
  return (
    <Card className="rounded-2xl shadow-md">
      <CardContent className="p-6 space-y-4">
        <h2 className="text-xl font-semibold">Experience</h2>
        {profile.experience.map((exp, i) => (
          <div key={i}>
            <p className="font-semibold">{exp.role} @ {exp.company}</p>
            <p className="text-sm text-gray-600 dark:text-gray-400">{exp.duration}</p>
            <p>{exp.description}</p>
          </div>
        ))}
      </CardContent>
    </Card>
  );
}

function EducationSection() {
  return (
    <Card className="rounded-2xl shadow-md">
      <CardContent className="p-6">
        <h2 className="text-xl font-semibold mb-2">Education</h2>
        {profile.education.map((edu, i) => (
          <div key={i}>
            <p className="font-semibold">{edu.degree}</p>
            <p className="text-sm text-gray-600 dark:text-gray-400">{edu.school} • {edu.year}</p>
          </div>
        ))}
      </CardContent>
    </Card>
  );
}

function SkillsSection() {
  return (
    <Card className="rounded-2xl shadow-md">
      <CardContent className="p-6">
        <h2 className="text-xl font-semibold mb-2">Skills</h2>
        <div className="flex flex-wrap gap-2">
          {profile.skills.map((skill, i) => (
            <span key={i} className="bg-gray-200 dark:bg-gray-700 text-sm rounded-full px-3 py-1">
              {skill}
            </span>
          ))}
        </div>
      </CardContent>
    </Card>
  );
}

function ProjectsSection() {
  return (
    <Card className="rounded-2xl shadow-md">
      <CardContent className="p-6 space-y-4">
        <h2 className="text-xl font-semibold mb-2">Projects</h2>
        {profile.projects.map((project, i) => (
          <div key={i}>
            <p className="font-semibold">{project.name}</p>
            <p className="text-sm text-gray-600 dark:text-gray-400">{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer" className="text-blue-600 inline-flex items-center">
              <Link className="w-4 h-4 mr-1" /> View Project
            </a>
          </div>
        ))}
      </CardContent>
    </Card>
  );
}

export default function App() {
  const [darkMode, setDarkMode] = useState(false);

  useEffect(() => {
    const savedMode = localStorage.getItem("theme") === "dark";
    setDarkMode(savedMode);
  }, []);

  const toggleTheme = () => {
    setDarkMode((prev: boolean) => {
      const newMode = !prev;
      localStorage.setItem("theme", newMode ? "dark" : "light");
      return newMode;
    });
  };

  return (
    <Router>
      <Layout toggleTheme={toggleTheme} darkMode={darkMode}>
        <Routes>
          <Route path="/" element={<>
            <AboutSection />
            <SkillsSection />
          </>} />
          <Route path="/experience" element={<ExperienceSection />} />
          <Route path="/education" element={<EducationSection />} />
          <Route path="/projects" element={<ProjectsSection />} />
        </Routes>
      </Layout>
    </Router>
  );
}
